import React from 'react';

import classes from './Header.module.css';
import headerImage from '../../../assets/header.jpeg';

const Header = () => {
    return (
        <>
            <header className={classes['header']}>
                <button>Click</button>
            </header>
            <div>
                <img
                    className={classes['main-image']}
                    src={headerImage}
                    alt="Header"
                />
            </div>
        </>
    );
};

export default Header;
